import React from 'react'
import '../styles/card.css'
import logo from "../media/scrappyhead_sticker.png"

export default function Navbar() {
  return (
    <div className="navbar" id="navbar">
        <img src={logo}/>
        <h1>BotBracket</h1>
        <ul>
            <Link href="#navbar"><li>Home</li></Link>
            <Link href='#tournaments'><li>Tournaments</li></Link>
            <Link href='#roster'><li>Roster</li></Link>
            <Link href='#bracket'><li>Bracket</li></Link>
            &nbsp;
        </ul>
        {/* <i className="material-icons" id="burger">menu</i> */}
    </div>
  )
}
